import React from 'react';
import Layout from "./hoc/Layout"

function App() {
  return (
    <div className="App">
      <Layout>
        <div style={{border: "1px solid black", width: "400px"}}>
          <h1>Layout works!</h1>
        </div>
      </Layout>
    </div>
  );
}

export default App;
